import React, { Component } from 'react';

class ClassCompoMenu extends Component {
    render() {
        return (
            <>
                <ol>
                    <li>
                        <Link to="component">what is component</Link>
                    </li>
                </ol>
            </>
        );
    }
}

export default ClassCompoMenu;
